    static class BiglineVisitor extends TParseTreeVisitor {
        public void preVisit(TInsertSqlStatement insertSqlStatement) {
            TMultiTargetList multiTargetList = insertSqlStatement.getValues();
            TMultiTarget multiTarget = multiTargetList.getMultiTarget(0);
            TResultColumnList resultColumnList = multiTarget.getColumnList();
            TResultColumn resultColumn = resultColumnList.getResultColumn(0);
            String transformedFirstQuery = formatTransformedFirstColumn();
            setParserNodeString(resultColumn, transformedFirstQuery);
        }
    }

    static void parseQuery(TGSqlParser sqlParser, String query)
    {
        try {
            sqlParser.setSqltext(query);
            int ret = sqlParser.parse();
            if (ret != 0) {
                System.out.println("Parser error:" + sqlParser.getErrormessage());
                System.exit(1);
            }
        }
        catch (Exception e) {
            System.out.println("Parser exception: " + e.toString());
            e.printStackTrace();
            System.exit(1);
        }
    }

    static void setParserNodeString(TParseTreeNode node, String value)
    {
        try
        {
            node.setString(value);
        }
        catch (Exception e)
        {
            System.out.println("Parser exception: " + e.toString());
            e.printStackTrace();
            System.exit(1);
        }
    }

